//=======================================================================//
//= Function define.										            =//
//=======================================================================//
void SGUI_Resource_GetBitmap_GB2312(SGUI_BMP_RES* pstBitmapData,SGUI_UINT32 uiCode,SGUI_BOOL bDryRun) {
    /*----------------------------------*/
	/* Variable Declaration				*/
	/*----------------------------------*/
	const SGUI_FONT_RES*        pstFontRes;
	SGUI_UINT8					uiLowByte, uiHighByte;

    /*----------------------------------*/
	/* Initialize						*/
	/*----------------------------------*/
	pstFontRes                  = SGUI_FONT_REF(GB2312_FZXS12);

	pstBitmapData->fnGetPixel   = SGUI_BMP_SCAN_MODE_DHPV;
	pstBitmapData->iHeight      = pstFontRes->iHeight;

	#ifdef SGUI_CONF_GRAYSCALE_COLOR_MAPPING_ENABLED
	pstBitmapData->uiDepthBits  = pstFontRes->uiDepthBits;
	#endif // SGUI_CONF_GRAYSCALE_COLOR_MAPPING_ENABLED

	uiHighByte                  = (uiCode & 0xFF00)>>8;
	uiLowByte                   = uiCode & 0x00FF;

    /*----------------------------------*/
	/* Process							*/
	/*----------------------------------*/
	if(uiCode>=' ' && uiCode <= '~'){
		pstBitmapData->iWidth   = 6;
        pstBitmapData->pData    = GB2312_H12 + GB2312_ASCII_OFFSET+(uiCode-0x20)*12;
	}else if(uiCode>0xA1A0 && uiCode < 0xA9FF){
	    pstBitmapData->iWidth   = 12;
	    pstBitmapData->pData    = GB2312_H12 + GB2312_SYMBOL_OFFSET+((uiHighByte-0xA1)*94 + (uiLowByte-0xA1))*24;
	}else if(uiCode > 0xB0A0 && uiCode < 0xF7FF){
	    pstBitmapData->iWidth   = 12;
        pstBitmapData->pData    = GB2312_H12 + GB2312_CHAR_OFFSET+((uiHighByte-0xB0)*94 + (uiLowByte-0xA1))*24;
	}
}
